    /****************************************************************
     * function name : setLUT describe :
     * 通过参数设置图像的对比度和亮度，输出一个通道的调整结构，使用时需要将几个通道合并起来写入LUT硬件表格中
     * parm : light设置亮度调整曲线索引
     * 当值为10是为不调整，当值小于10时变暗，大于10时变亮 调整范围是 0~20 :
     * contrast 设置对比度曲线索引
     * 当值为10时不调整，当值小于10时对比度降低，当值大于10是对比度增强，调整范围是0~20
     * 2012.08.05 罗宁 rockchip
     ****************************************************************/
    public void computeLUTData(int light, int contrast) {
        resetData();
        int i;
        long pl[], pc[];

        if ((light >= 0) && (light <= 20))
            pl = light_t[light];
        else
            pl = light_t[10];

        if ((contrast >= 0) && (contrast <= 20))
            pc = contrast_t[contrast];
        else
            pc = contrast_t[10];

        for (i = 0; i < 256; i++) {
            long tmp;

			/*tmp = pl[i] * pc[i];
			tmp = (tmp + 0x8000) >> 16;
			tmp = tmp * div_t[i];
			tmp = (tmp + 0x8000) >> 16;
			int tmp_int = (int) tmp;
			xrgb_map[i] = tmp_int;*/
            tmp = pl[i] * pc[i];
            tmp = (tmp + 0x8000) >> 16;
            tmp = tmp & 0xffff;
            tmp = tmp * div_t[i];
            tmp = (tmp + 0x8000) >> 16;
            tmp = tmp & 0xffff;
            if (tmp > 255)
                tmp = 255;
            int tmp_int = (int) tmp;
            xrgb_map[i] = tmp_int;
        }
        // convert value to xrgb string array.
        // setLUTDataToString();
    }

    public void extendXRGBData() {
        for (int i = 0; i < 256; i++) {
            int tmp_int = xrgb_map[i];
            int temp_i = xrgb_map[i];
            for (int j = 0; j < 2; j++) {
                temp_i = temp_i << 8;
				/*	Log.d(TAG, " xrgb_map i=" + i + " temp_i value = " + temp_i
				+ " temp value " + tmp_int);*/
                temp_i = temp_i | tmp_int;
            }
            data_bkp += "0x";
            data_bkp += Integer.toHexString(temp_i);
            data += temp_i;
            data += " ";
            data_bkp += ", ";
        }
    }


