    void initData() {
        if (USE_MAP_TABLE)
            ;//computeLUTData(default_light, default_contrast);
        else {
            for (int i = 0; i < 256; i++) {
                for (byte j = 0; j < 4; j++) {
                    xrgb_map[i] = i;
                }
            }

        }
    }

    void resetData() {
        data = "";
        data_bkp = "";
        if (!USE_MAP_TABLE) {
            initData();
        }
    }


    void computeLuminance(float k, int b) {
        resetData();
        // change luminance for color.
        for (int i = 0; i < 256; i++) {
            int temp = xrgb_map[i] = (int) (k * i + b);
            if (temp > 255) {
                temp = 255;
                xrgb_map[i] = 255;
            } else if (temp < 0) {
                temp = 0;
                xrgb_map[i] = 0;
            }
            int temp_i = temp;
            for (int j = 0; j < 2; j++) {
                temp_i = temp_i << 8;
                Log.d(TAG, " xrgb_map i=" + i + " temp_i value = " + temp_i + " temp value " + temp);
                temp_i = temp_i | temp;
            }
            Log.d(TAG, " xrgb_map i=" + i + " value = " + temp_i);
            data += temp_i;
            data += " ";
        }
        Log.d(TAG, " data to write file is " + data);
    }

    public void computeGamma(float factor) {
        resetData();
        // change gamma for color.
        for (int i = 0; i < 256; i++) {
            double var = xrgb_map[i] / 255.0f;
            var = Math.pow(var, factor);
            int temp_i = (int) (var * 255);
            int temp = xrgb_map[i] = temp_i;
            Log.d(TAG, " xrgb_map i=" + i + " temp_i value = " + temp_i + " temp value " + temp);
            for (int j = 0; j < 2; j++) {
                temp_i = temp_i << 8;
                temp_i |= temp;
            }
            data += temp_i;
            data += " ";
        }
        Log.d(TAG, " data to write file is " + data);
    }
